$(document).ready(function(){
    $('#vehicles').keypress(function(e){
      if(e.keyCode==13)
      $('#search').click();
    });
});

function getVehicles() {
  var pipeDelmitedVehicles = document.getElementById("vehicles").value;
  if (pipeDelmitedVehicles !== "") {
    if (pipeDelmitedVehicles.includes("Chop List")) {pipeDelmitedVehicles = pipeDelmitedVehicles.slice(pipeDelmitedVehicles.indexOf("remaining)")+10, pipeDelmitedVehicles.length);}
    var vehiclesArr = pipeDelmitedVehicles.split("|");
    var table = document.getElementById("vehiclesTable");
    clearTable(table);
    var imgLink, row, vehicleCell, html, priority;
    var rowIndex, cellIndex = 0; 
    for (var i = vehiclesArr.length-1; i >= (-1); i--) {
      //reset parameters
      html = "";
      if (cellIndex % 5 === 0) {
        cellIndex = 0;
        rowIndex = rowIndex+1;
        row = table.insertRow(0);
      }      
      //check if vehicle is priority
      priority = vehiclesArr[i].includes("(priority)");
      if (priority) {vehiclesArr[i] = vehiclesArr[i].replace("(priority)", "");}
      imgLink = getVehiclePicture(vehiclesArr[i].replace(/ /g,'').toLowerCase());     
      if (imgLink !== "") {      
        vehicleCell = row.insertCell(cellIndex);
        if (priority){
          html += '<div style=\"background-color:yellow;\"><b>' + vehiclesArr[i] + '</b><br><img src="'.concat(imgLink, '">') + '</div>';
        }else{
          html +='<div><b>' + vehiclesArr[i] + '</b><br><img src="'.concat(imgLink, '">');
        }
        vehicleCell.innerHTML = html;         
      } else{       
        vehicleCell = row.insertCell(cellIndex);
        html = "<b> Unable to find" + vehiclesArr[i] + "</b>";
        vehicleCell.innerHTML = html;
      }//end else
      cellIndex = cellIndex + 1;
    } //end for
  } //end if empty string
} //end function

function clearTable(table) {
  table.innerHTML = "";
}

function getVehiclePicture(dictKey) {
  //console.log(dictKey);
  if(!dictVehicles[dictKey]){return "";}
  return dictVehicles[dictKey];
}

